import Header from "./Header";
import { useState } from "react";
import { useEffect } from "react";
import { useLocation } from "react-router-dom";
//Accessing passed route state

function ResultPage() {
  const location = useLocation();
  // const [resultData, setResultData] = useState([]); 

  // useEffect(() => {
  //   if (location.state?.responseData) {  // if not null
  //     setResultData(location.state.responseData); // set resultData to the data rendered from previous page
  //   }
  // }, [location.state]); // Re-run if location.state changes

  const resultData = [
    {
      Items: "Original Glazed Doughnuts (Doze)",
      Stores: "Krispy Kreme",
      Quantity: 1,
      Prices: 39.6,
      Total: 39.6
    },
    {
      Items: "Happy Sharing Combo",
      Stores: "McDonald's",
      Quantity: 1,
      Prices: 35.7,
      Total: 35.7
    },
    {
      Items: "Oreo McFlurry",
      Stores: "McDonald's",
      Quantity: 10,
      Prices: 3.85,
      Total: 38.5
    },
    {
      Items: "Happy Sharing Snacks",
      Stores: "McDonald's",
      Quantity: 1,
      Prices: 25.7,
      Total: 25.7
    },
    {
      Items: "Milo Drink (24 x200ml)",
      Stores: "Sheng Siong",
      Quantity: 1,
      Prices: 13.95,
      Total: 13.95
    }
  ];


  return (
    <div>
      <Header />
      <h1 style={titleStyle}>Your Personalized Shopping List</h1> 
      <div style ={constentStyle}></div>
      <div className="resultTable">
        <table style={tableStyle}>
          <thead>
            <tr style={{ backgroundColor: "#f2f2f2" }}>
              <th>Items</th>
              <th>Stores</th>
              <th>Quantity</th>
              <th>Prices</th>
              <th>Total</th>
            </tr>
          </thead>
          <tbody>
            {resultData.map((item) => (
              <tr>
                <td>{item.Items}</td>
                <td>{item.Stores}</td>
                <td>{item.Quantity}</td>
                <td>{item.Prices}</td>
                <td>{item.Total}</td>
              </tr>
            ))}
            {/* if no {}, it will be considered as text instead of js code ; */}
          </tbody>
        </table>
      </div>
      <h1 style={feedbackStyle}>Not Satisfied With The Result? Any Feedback?</h1>
    </div>
  );
}

export default ResultPage;
const titleStyle = {
  borderWidth: "0px",
  position: "relative",
